#include "../hooks.h"

//minhook
namespace hooks
{
	void __stdcall override_view::hook(c_viewsetup* vsView)
	{
		grenade_prediction::view();

		misc::no_smoke();

		if (g_engine_client->is_ingame() && vsView)
		{

			if (g_local_player->m_vecVelocity().Length2D() <= 0.f) {
				g_local_player->get_player_anim_state()->m_flUnknownFraction = 0.f;
			}
			visuals::third_person();
			visuals::SetThirdpersonAngles();
		}

		if (g_local_player && g_engine_client->is_ingame() && g_local_player->is_alive())
		{
			if (settings::misc::viewmodel::override != 0 && !g_local_player->m_bIsScoped())
				vsView->fov = settings::misc::viewmodel::override;

			if (settings::misc::disable_zoom && g_local_player->m_bIsScoped())
				vsView->fov = (settings::misc::viewmodel::override == 0) ? 90 : settings::misc::viewmodel::override;
		}

		o_override_view(g_client_mode, vsView);
	}
}




